    public String getReadPermission(int propId) {
        Pair<String, String> p = this.mProps.get(propId);
        if (p != null) {
            if (p.first == null) {
                Slog.e(TAG, "propId is not available for reading : 0x" + Integer.toHexString(propId));
            }
            return (String) p.first;
        }
        return null;
    }

    public String getWritePermission(int propId) {
        Pair<String, String> p = this.mProps.get(propId);
        if (p != null) {
            if (p.second == null) {
                Slog.e(TAG, "propId is not writable : 0x" + Integer.toHexString(propId));
            }
            return (String) p.second;
        }
        return null;
    }

    public List<Integer> getMultiplePropertyIds() {
        List<Integer> list = new ArrayList<>();
        list.add(Integer.valueOf((int) VehicleProperty.MCU_PM_STATE));
        return list;
    }

    public boolean insertVendorProperty(int propId) {
        return true;
    }

    public boolean isSupportedProperty(int propId) {
        if (this.mProps.get(propId) != null) {
            return true;
        }
        return insertVendorProperty(propId);
    }

    public boolean isPropertyToChangeUnits(int propertyId) {
        return this.mPropForUnits.contains(Integer.valueOf(propertyId));
    }
